eval("module.exports = \"<p>Core features of a React-based static site generator:</p>\\n<ul>\\n<li>Use React components to define the structure of layouts &amp; pages, including the root <html>...</html> layout.</li>\\n<li>Author content using Markdown, with the ability to define arbitrary metadata (e.g. title, description) and specify a custom layout in which the content will be rendered.</li>\\n<li>Directory-based routing: the path to a page matches its location on the file system.</li>\\n<li>Static HTML files are generated for <em>every</em> route as part of the build step.</li>\\n<li>Client-side routing is used once a page is loaded by the browser, for instant page transitions.</li>\\n<li>Able to generate client-side links in both React components <em>and</em> Markdown pages.</li>\\n<li>Able to extend with custom module loaders (e.g. for CoffeeScript or reStructuredText).</li>\\n<li>Minimal API surface area: by default, little to no configuration should be required to get started, and extending/customizing behaviour should be simple and easy.</li>\\n<li>Easy-to-use development mode: start a development server with a single command, with in-browser debugging support and sane error messages.</li>\\n<li>Able to include arbitrary assets (e.g. robots.txt) in the generated static site.</li>\\n<li>The production-ready static site is optimized for size: at a minimum, JS and CSS are minified.</li>\\n<li>A sane default 404 page, and the ability to provide a custom one.</li>\\n<li>A sane API to access all site data from within React components (e.g. to enumerate all pages and their metadata).</li>\\n</ul>\\n<p>Bonus features:</p>\\n<ul>\\n<li>Hot module replacement: updating a component reloads only the changed component.</li>\\n<li>Lazily-loaded modules (i.e. code splitting): the initial JS bundle is small; additional modules (e.g. other pages) are downloaded on-the-fly.</li>\\n<li>Able to define custom path redirects.</li>\\n<li>Able to serve site on a prefixed path (e.g. a GitHub pages project site).</li>\\n<li>Able to define a custom path structure for pages based on their metadata, e.g. based on date: <code>/2015-12-29--some-blog-post</code>.</li>\\n<li>Preconfigured project templates are defined for different use cases, e.g. documentation sites / blogs.</li>\\n<li>Able to persist state between client-side page transitions, e.g. a menu open/close state.</li>\\n<li>First-class support for localization.</li>\\n<li>Support for generating <a href=\\\"https://en.wikipedia.org/wiki/RSS\\\">RSS</a> or <a href=\\\"https://en.wikipedia.org/wiki/Atom_(standard)\\\">Atom</a> feeds.</li>\\n<li>First-class support for GitHub pages: easily publish the static site with a single command.</li>\\n</ul>\\n<h2>Features</h2>\\n<ul>\\n<li>Author content using Markdown</li>\\n<li></li>\\n</ul>\\n<h2>Detractors</h2>\\n\";//# sourceMappingURL=data:application/json;charset=utf-8;base64,");

